import Head from 'next/head'



function Projects(person) {
  


  return (
    <div className="container">
        <Head>
          <title>Aiman Adlawan | Projects</title>
          <link rel="icon" href="/images/brand-icon-logo.ico" />
        </Head>

        <div className="container">
          {/* <TopLayover/> */}
          <div className="main-container">
            <p>{person.name}</p>
            {/* <PageDataContext pagesets={'contacts'}>
              <Navbar />       
              <Menu />
              <main className='main'>
              <Header/>
              <Message />
              <Footer />
              </main>
            </PageDataContext> */}
          </div>
        </div>
      </div>
  )
}
let projectRoutes = ['music-app', 'reservation-app', 'electric-bill', 'music-player3', 'music-player4', 'music-player5']

export async function getStaticProps(){
  return {
    props: {
      person: {
        name: 'manski'
      }
    }
  }
}

export async function getStaticPaths(){
  return {
    paths: [
      { params: {projects: 'music-app'}},
      { params: {projects: 'reservation-app'}},
      { params: {projects: 'electric-bill'}},
      { params: {projects: 'music-player3'}},
      { params: {projects: 'music-player4'}},
      { params: {projects: 'music-player5'}},
    ],
    fallback: false
  }
}

export default Projects
